import Contact from './components/Contacts';

function App() {
  return (
    <div className='contacts'>
      <Contact
        img="./images/cats/mr-whiskerson.png"
        names="Mr. Whiskerson"
        phone="(212) 555-1234"
        email="mr.whiskaz@catnap.meow"
      />
      <Contact 
        img="./images/cats/fluffykins.png"
