      />
      <Contact
        img="./images/cats/felix.png"
        names="Felix"
        phone="(212) 555-4567"
        email="thecat@hotmail.com"
      />
      <Contact 
        img="./images/cats/pumpkin.png"
        names="Pumpkin"
        phone="(0800) CAT KING"
        email="pumpkin@scrimba.com"
      />
      {/* <Navbar /> */}
      {/* <Hero /> */}
      {/* <Card /> */}
    </div>
  );
}

export default App;
